func TestOBV(t *testing.T) {
	t.Parallel()
	list := InitTestKline()
	//计算新的OBV
	stock := NewOBV(list)
	stock.Calculation()
	obvList := stock.GetPoints()

	//计算MAOBV30
	var maObvArray []float64
	for _, v := range obvList {
		maObvArray = append(maObvArray, v.Value)
	}
	maOBV := NewMA(maObvArray, 30)
	maOBV.Calculation()
	for i := 0; i < len(maObvArray); i++ {
		fmt.Printf("[%d]Time:%s\t Value:%f	MAOBV(30):%f\n", i, obvList[i].Time.Format("2006-01-02 15:04:05"), obvList[i].Value, maOBV.Value[i])
	}
}

